const Them = () =>{
    return(
        <div >
            <form action="#" method="POST" role="form" encType="multipart/form-data" >
                <div style={{margin: 30,width: '100%', height: '100px', display: 'flex', justifyContent: 'space-around'}}>

                </div>
                
                <input type="submit" value="Submit"></input>
            </form>
        </div>
    );
}
export default Them;
